Six friends are on their way to a football game. They decide to camp out for the night and continue driving the next day. The next day the friends find that their having car troubles, so two of the friends accept a strangers ride into a small town named Ambrose. The main attraction in Ambrose is the House of Wax. Except something is not right in this town the wax figures are so realistic and the whole town is deserted- except for two murderous twin brothers. The six friends must fight to survive and escape from being the next exhibits in the House of Wax. Starring Chad Michael Murray, Jared Padalecki, Elisha Cuthbert, Paris Hilton, Jon Abrahams and Robert Ri'chard.

Carly Jones (Elisha Curtberth), her bad boy brother Nick (Chad Michael Murray), her boyfriend Wade (Jared Padalecki), and her friends Paige (Paris Hilton) and her boyfriend Blake (Robert Richard) and Dalton (Jon Abrahams) travel to another city to watch an important game. They decide to camp in a field halfway and proceed their journey on the next day. However, the fan belt of Wade's car breaks and he stays with Carly to buy a new one in a close town, where there is a house of wax. When they arrive in the place, they realize that the place is a ghost town, and two deranged former Siamese brothers have transformed people in wax statues.
